def solver(word1, word2):
    return dfs(word1, word2, {})

# given index, return min edit distance for that index
# edits can be remove from the longer strand, swap
# for each char, consider remove from long, swap, and if at that index, same, not chance 
def dfs(short, long, memo = {}): 
    if (short, long) in memo: 
        return memo[(short,long)]
    if len(short) == len(long) and len(short) == 0: 
        return 0 
    # edits
    poss = []
    if len(short) != 0 and len(long) != 0:
        if short[0] == long[0]: 
            poss.append(dfs(short[1:], long[1:], memo))
        else: 
            poss.append(1 + dfs(short[1:], long[1:], memo)) 
    if len(long) != 0: 
        poss.append(1 + dfs(short, long[1:], memo))
    if len(short) != 0: 
        poss.append(1+ dfs(short[1:], long, memo))
    result = min(poss)
    memo[(short, long)] = result
    return result
    
def tb(word1, word2): 
    m = len(word1)
    n = len(word2)
    # dp[i][j] := min # Of operations to convert word1[0..i) to word2[0..j)
    dp = [[0] * (n + 1) for _ in range(m + 1)]

    for i in range(1, m + 1):
      dp[i][0] = i

    for j in range(1, n + 1):
      dp[0][j] = j

    for i in range(1, m + 1):
      for j in range(1, n + 1):
        if word1[i - 1] == word2[j - 1]:
          dp[i][j] = dp[i - 1][j - 1]
        else:
          dp[i][j] = min(dp[i - 1][j - 1], dp[i - 1][j], dp[i][j - 1]) + 1

    return dp[m][n]


